        <ul className="list-disc list-inside mt-3 text-gray-700 text-lg space-y-1">
          <li><strong>Phone:</strong> 7032967505</li>
          <li><strong>Email:</strong> muskaansayyad769@gmail.com</li>
        </ul>
      </div>
    </div>
  );
};

export default Contact;
